import React, { useRef, useState } from "react";
import VideoFooter from "./VideoFooter";
import VideoSidebar from "./VideoSidebar";
import "./Video.css";
function Video() {
  const [playing, setPlaying] = useState(false);
  const videoref = useRef(null);
  const handelVideoPress = () => {
   
    if (playing) {
      videoref.current.pause();
      setPlaying(false);
    } else {
      videoref.current.play();
      setPlaying(true);
    }


    // play it
  };
  return (
    <div className="video">
      <video
        onClick={handelVideoPress}
        className="video__player"
        loop
        ref={videoref}
        src="https://v16-webapp.tiktok.com/d19543c1bfd320c2a21e584aef9ceead/63bc5711/video/tos/alisg/tos-alisg-pve-0037c001/oQ7ZfYLDEcTAiDfbIA7AzUZZC0YeBeP5bYamef/?a=1988&ch=0&cr=0&dr=0&lr=tiktok_m&cd=0%7C0%7C1%7C0&cv=1&br=1328&bt=664&cs=0&ds=3&ft=hatGN2W7jVQ9wyi~0Dhd.-AUkX4gTsU9pWqFA4YqEeC&mime_type=video_mp4&qs=0&rc=NTY2M2c2ZGllOzdoM2lnOEBpanV5O2Y6ZnA6aDMzODczNEA1Y2M1Ly0yNmIxMi9gYmFjYSNjMGBqcjQwb29gLS1kMS1zcw%3D%3D&l=202301091202593CEEC0AABFBF380AE2C4&btag=80000"
      ></video>

 
    </div>
  );
}

export default Video;
